function processMsg (id) {
  let msg = respawnMsg[id], space = Math.max(...respawnMsg.map(x => x.length)) - msg.length;
  return Array(Math.round(space/2)).fill(" ").join("")+msg+"..."+Array(Math.trunc(space/2)).fill(" ").join("");
}

