var map_id, map;

function resetFlag() {
  for (let i=0; i<2; i++){
    teams.x.flag[i] = map.flags[i].x;
    teams.x.spawn[i] = map.ship_spawn[i].x;
    teams.x.target[i] = map.ship_spawn[i].x;
    teams.y.flag[i] = map.flags[i].y;
    teams.y.spawn[i] = map.ship_spawn[i].y;
    teams.y.target[i] = map.ship_spawn[i].y;
    backupFlag(i);
  }
}

function backupFlag(i) {
  flags_drop.x[i] = teams.x.flag[i];
  flags_drop.y[i] = teams.y.flag[i];
  teams.flag_dropped_time[i] = 0;
}

function mapcredit(ship){
  sendUI(ship, {
    id: "map info",
    position: [56,88,24,22],
    visible: true,
    components: [
      {type: "text",position:[0,0,100,50],value:`Map: ${maps[map_id].name} by ${maps[map_id].author}`,color:"#cde"},
    ]
  });
}

var size = ms || 30, zoom = 10/size;
var transform = {
  X: x => x+size*5,
  Y: y => -y+size*5
};
let t = num => Math.max(num,0) || 0;
var flagstand_size = 10;
let map_size = 60;
let limit = map_size*5-10;
let update = 1, delayed = 0;
let gamelength = toTick(match_time+0.25);
this.tick = function(game){
  modUtils.tick();
  if (game.step % 15 === 0){
    if (game.ships.length < 2){
      delayed=1;
      for (let ship of game.ships){
        if (!ship.custom.wait){
          ship.custom.wait = true;
          ship.set({type:121});
          setteam(ship);
          checkPlayerScore(ship);
          updateFlagStats();
          ship.custom.respawn_delay = 0;
        }
        setIdle(ship);
        ship.set({x:0,y:0});
        if (!ship.custom.delayed) {
          sendUI(ship, {
            id: "scoreboard",
            visible:true,
            components: [
              { type: "text",position:[15,0,70,10],value:"Waiting for more players...",color:"#cde"},
            ]
          });
          sendUI(ship, {
            id: "timer",
            visible:false,
            components: []
          });
          sendUI(ship, {
            id: "scores",
            visible:false,
            components: []
          });
          sendUI(ship, {
            id: "wait", position: [39,30,22,50], visible: true,
            components: [
              { type: "text",position:[0,0,100,10],value:"Waiting for more players...",color:"#cde"},
            ]
          });
          ship.custom.delayed = true;
        }
        if (!ship.custom.remove_buttons){
          ship.custom.remove_buttons = true;
          sendUI(ship, logo);
        }
        if (!game.custom.radar_hide) {
          game.setCustomMap("");
          game.custom.radar_hide = true;
        }
      }
    } else {
      if (delayed){
        restartgame(game);
        delayed=0;
      } else {
        teams.ships = [[],[]];
        teams.count = [0,0];
        for (let ship of game.ships){
          if (!ship.custom.init){
            ship.custom.init = true;
            if (!ship.custom.wait){
              ship.custom.wait = false;
              ship.set({type:121});
            }
            sendUI(ship, {
              id: "buy_lifes_blocker",
              visible: true,
              clickable: true,
              shortcut: String.fromCharCode(187),
              position: [65,0,10,10],
              components: []
            });
            setteam(ship);
            selectship(ship);
            mapcredit(ship);
            joinmessage(ship);
            ship.custom.respawn_delay = 0;
            checkPlayerScore(ship);
            update = 1;
          }
          if (ship.custom.delayed)
          {
            sendUI(ship, {id:"wait",visible:false});
            ship.custom.delayed = false;
          }
          if (!teams.flagholder[1-ship.custom.team]) checkFlag(ship);
          if ((!teams.flagholder[ship.custom.team]) && flags_can_drop) returnFlag(ship);
          checkTarget(ship);
          setIdle(ship);
          teams.ships[ship.custom.team].push(ship);
          teams.count[ship.custom.team]++;
          if (ship.score != ship.flags) ship.set({score:ship.flags});
          let sec = ~~(((ship.custom.choose_countdown||0)-game.step)/60);
          if (sec >= 0){
            ship.custom.countdown_hide = false;
            sendUI(ship, {
              id: "countdown",
              position:[45,85,10,10],
              components:[
                {type:"text",position:[0,0,100,100], color: "#cde", value: sec}
              ]
            });
          }
          else if (!ship.custom.countdown_hide) {
            sendUI(ship, {id:"countdown",visible:false});
            ship.custom.countdown_hide = true;
          }
          let respawnDelay = Math.trunc((ship.custom.respawn_delay - game.step)/60);
          if (respawnDelay >= 0 && ship.death_stroke != 0 && ship.custom.respawnMsgIndex != null) {
            let rmsg = processMsg(ship.custom.respawnMsgIndex);
            if (ship.alive){
              sendUI(ship, {
                id: "respawn_delay",
                visible: true,
                position: [39,70,22,18],
                components: [
                  {type: "text",position:[0,0,100,33.3],value:"Please stand by",color:"#cde"},
                  {type: "text",position:[0,33.3,100,33.3],value:rmsg,color:"#cde"},
                  {type: "text",position:[0,66.7,100,33.3],value:respawnDelay,color:"#cde"}
                ]
              });
              ship.set({invulnerable:100});
            }
            ship.custom.respawn_hide = false;
          }
          else if (!ship.custom.respawn_hide) {
            sendUI(ship, {id:"respawn_delay",visible:false});
            ship.custom.respawn_hide = true;
          }
        }
        let steps = gamelength - game.step;
        if (steps <= toTick(match_time)) {
          let minutes = ~~(steps / 3600);
          let seconds = ~~((steps % 3600) / 60);
          if (seconds < 10) seconds = "0" + seconds;
          if (minutes < 10) minutes = "0" + minutes;
          sendUI(game, {
            id: "timer",
            position: [3,28,17,15],
            visible: true,
            components: [
              {type: "text",position:[0,0,80,33],value:`Time left: ${minutes}:${seconds}`,color:"#cde"},
            ]
          });
          game.custom.timer_hide = false;
        }
        else if (!game.custom.timer_hide){
          sendUI(game, {id:"timer",visible:false});
          game.custom.timer_hide = true;
        }
        if (((teams.count.indexOf(0) != -1) || (game.step >= gamelength) || Math.max(...teams.points) >= pointsToWin) && (gamelength-game.step< toTick(match_time))){
          gamelength=game.step+toTick(match_time+0.25);
          resetgame(game, teams.count.indexOf(0));
        }
        for (let i=0;i<2;i++) {
          if (teams.flag_dropped_time[i] && teams.flag_dropped_time[i]<game.step) {
            backupFlag(i);
            setNotif(teams.names[i]+"'s flag was auto-returned!", "Chance for "+teams.names[1-i]+" team is now over!");
            updateFlagStats();
          }
        }
      }
      for (let ship of game.ships){
        for (let i=0;i<2;i++){
          if (!teams.flagholder[i]) drawDirectionMarker(ship,flags_drop.x[i],flags_drop.y[i],true,true,`team${i+1}flag`,getcolor(teams.hues[i]),"\u{1F3F4}");
          else {
            if (ship.id != teams.flagholder[i].id) drawDirectionMarker(ship,teams.flagholder[i].x,teams.flagholder[i].y,true,true,`team${i+1}flag`,getcolor(teams.hues[i]),"\u{1F3F4}");
            else sendUI(ship, {id:`team${i+1}flag`,visible:false});
          }
        }
        if (!ship.custom.flagged){
          ship.custom.flagged = true;
          checkscores(ship);
          checkflagholderstatus(ship);
        }
      }
      if (!flagged){
        getFlagsObj(game);
        flagged = true;
      }
      if (update === 1){
        updatescoreboard(game);
        update = 0;
      }
      typeof (map||{}).cars == "function" && map.cars(game);
    }
  }
};
