function resetgame(game,isLeave){
  for (let ship of game.ships) ship.set({type:121,x:0,y:0,vx:0,vy:0,invulnerable:600});
  let color, text, win, points;
  if (isLeave != -1){
    win=1-isLeave;
    text = `All ${teams.names[isLeave]} players left. ${teams.names[win]} team wins!`;
    color = "#cde";//getcolor(teams.hues[win]);
    teams.round_points[win]++;
  } else {
    if (teams.points[0] != teams.points[1]){
      win=teams.points.indexOf(Math.max(...teams.points));
      text = `Round finished! ${teams.names[win]} team wins!`;
      color = "#cde";//getcolor(teams.hues[win]);
      teams.round_points[win]++;
    } else {
      text = "Round finished! It's a draw!";
      color = "#cde";
      points = teams.round_points.map(v=>v+0);
      teams.round_rounds = points;
    }
  }
  for (let ship of game.ships){
    if (ship.custom.team === win) ship.wins++;
    ship.rounds++;
    ship.custom.flag = false;
    ship.flags = 0;
  }
  updateFlagStats();
  sendUI(game, {
    id: "gamestat",
    position: [33.5,18,42,40],
    visible: true,
    components: [
      {type: "text",position:[0,0,80,33],value:text,color:color},
    ]
  });
  for (let i=0; i<2; i++){
    if (teams.round_points[i]===match_point){
      game.custom.over = true;
      win=teams.round_points.indexOf(Math.max(...teams.round_points));
      text=`Game finished! ${teams.names[win]} team wins!`;
    }
  }
  modUtils.setTimeout(function(){
    if (!game.custom.over){
      restartgame(game,1);
      teams.flagholder = [0,0];
      for (let ship of game.ships){
        ship.custom.flag = false;
      }
      updateFlagStats();
    } else {
      modUtils.setTimeout(function(){
        updateFlagStats();
        endgame(game);
        teams.flagholder = [0,0];
        sendUI(game, {id:"gamestat",visible:true});
        sendUI(game, {
          id: "gamestat",
          position: [33.5,18,42,40],
          visible: true,
          components: [
            {type: "text",position:[0,0,80,33],value:text,color:color},
          ]
        });
        modUtils.setTimeout(function(){
          for (let ship of game.ships){
            ship.gameover({
              "Score": ship.score,
              "Frags": ship.frags,
              "Deaths": ship.deaths,
              "Flags stolen": ship.flags_stolen,
            });
          }
        }, 300);
      }, 120);
    }
  }, 300);
}

