function shortestPath(x1, y1, x2, y2, wrapV = true, wrapH = true){
  var shortestDist = 10000;
  var map_size = ms*5;
  var coords = [];
  var xx = x2-x1;
  var yy = y2-y1;
  if(!wrapH&&!wrapV)return [xx, yy];
  coords.push(xx, yy);
  var shortest = [xx, yy];
  if(wrapH){
    xx = x2+map_size*2-x1;
    yy = y2-y1;
    coords.push(xx, yy);
    xx = x2-map_size*2-x1;
    yy = y2-y1;
    coords.push(xx, yy);
  }
  if(wrapV){
    xx = x2-x1;
    yy = y2+map_size*2-y1;
    coords.push(xx, yy);
    xx = x2-x1;
    yy = y2-map_size*2-y1;
    coords.push(xx, yy);
  }
  if(wrapV&&wrapH){
    xx = x2+map_size*2-x1;
    yy = y2+map_size*2-y1;
    coords.push(xx, yy);
    xx = x2+map_size*2-x1;
    yy = y2-map_size*2-y1;
    coords.push(xx, yy);
    xx = x2-map_size*2-x1;
    yy = y2+map_size*2-y1;
    coords.push(xx, yy);
    xx = x2-map_size*2-x1;
    yy = y2-map_size*2-y1;
    coords.push(xx, yy);
  }
  for(var i = 0; i<9; i++){
    var dist = sqrDist(coords[i*2], coords[i*2+1]);
    if(dist<shortestDist){
      shortestDist = dist;
      shortest = [coords[i*2], coords[i*2+1]];
    }
  }
  return shortest;
}

