  let add = [0,6,8,4,6,8,9,4], lvl = Math.trunc(data[0].code/100), type;// = [6,8,4,6,8,9,4][lvl-1] || 0;
  switch(lvl){case 1:type=6;break;case 2:type=8;break;case 3:type=4;break;case 4:type=6;break;case 5:type=8;break;case 6:type=9;break;case 7:type=4;break;}
