var drawDirectionMarker = function(ship, x, y, wrapV, wrapH, id, color, label){
  var sp = shortestPath(ship.x, ship.y, x, y, wrapV, wrapH);
  var dist = distance(sp[0],sp[1]);
  var x1 = sp[0]/dist;
  var y1 = sp[1]/dist;
  sendUI(ship, {
    id: id,
    position:[47+x1*30,49-y1*30,6*1.5,2*1.5],
    clickable: false,
    visible: true,
    components: [
      {type:"box",position:[40,30,20,40],fill:color,stroke:"#cde",width:2},
      {type:"text",position:[((x<0-50)?0:75),0,25,100],value:label,color:"#CDE"}
    ]
  });
};
