var scoreboard = {
  id:"scoreboard",
  visible: true,
  components: []
};

function PlayerBox(posx,posy) {
  return {type:"box",position:[posx,posy-1.8,50,7],fill:"rgb(56,74,92,0.5)",width:2};
}

function Tag(indtext,param,posx,posy,hex,al,size) {
  let obj= {type: indtext,position: [posx,posy-0.5,50-(size||0),5],color: hex,align:al};
  switch(indtext) {
    case "text":
      obj.value=param;
      break;
    case "player":
      obj.id=param;
      break;
  }
  return obj;
}

function sort(arr){
  let array=[...arr],i=0;
  while (i<array.length-1) {
    if (array[i].flags<array[i+1].flags) {
      array[i+1]=[array[i],array[i]=array[i+1]][0];
      if (i>0) i-=2;
    }
    i++;
  }
  return array;
}

function updatescoreboard(game){
  let t=[[],[]];
  for (let ship of game.ships) t[ship.custom.team].push(ship);
  let s,ss; if (teams.round_points[0]==1) s=" point"; else s=" points";
  if (teams.round_points[1]==1) ss=" point"; else ss=" points";
  scoreboard.components = [
    { type:"box",position:[0,0,50,8],fill:getcolor(teams.hues[0])},
    { type: "text",position: [0,0,50,8],color: "#000",value:`${teams.names[0]}(${teams.round_points[0]+s})`},
    { type:"box",position:[50,0,50,8],fill:getcolor(teams.hues[1])},
    { type: "text",position: [50,0,50,8],color: "#000",value:`${teams.names[1]}(${teams.round_points[1]+ss})`}
  ];
  let sc=[sort(t[0]),sort(t[1])],line=1;
  sc[0].slice(10);sc[1].slice(10);
  for (let i=0;i<10;i++){
    for (let j=0;j<2;j++){
      if (sc[j][i]) scoreboard.components.push(
        new Tag("text",sc[j][i].flags,j*50,line*10,"#cde","right",2),
        new Tag("player",sc[j][i].id,j*50,line*10,"#cde","left")
      );
      else scoreboard.components.push({},{});
    }
    line++;
  }
  outputscoreboard(game,sc);
}

function outputscoreboard(game,tm){
  let origin =[...scoreboard.components];
  for (let ship of game.ships){
    let j=0,team=tm[ship.custom.team];
    for (j=0;j<team.length;j++){
      if (ship.id === team[j].id){
        scoreboard.components.splice((j*2+ship.custom.team)*2+4,0,
          new PlayerBox(ship.custom.team*50,(j+1)*10)
        );
        break;
      }
    }
    if (j == team.length) scoreboard.components.splice((20+ship.custom.team)*2,2,
      new PlayerBox(ship.custom.team*50,90),
      new Tag("text",ship.flags,ship.custom.team*50,90,"#cde","right",2),
      new Tag("player",ship.id,ship.custom.team*50,90,"#cde","left")
    );
    sendUI(ship, scoreboard);
    scoreboard.components = [...origin];
  }
}
//End of scoreboarding//////////////////////////////////////////////////////////

this.event = function(event, game){
  let ship = event.ship;
  if (ship != null) {
    switch (event.name){
      case "ship_destroyed":
        if (ship.custom.flag){
          ship.custom.flag = false;
          if (flags_can_drop) {
            flags_drop.x[1-ship.custom.team] = ship.x;
            flags_drop.y[1-ship.custom.team] = ship.y;
          }
          ship.custom.flag_dropped = true;
          setNotif(ship.name+" dropped "+teams.names[1-ship.custom.team]+"'s Flag!", "Who will take it first?");
          updateFlagStats();
          teams.flagholder[1-ship.custom.team] = 0;
          teams.flag_dropped_time[1-ship.custom.team] = game.step + toTick(flag_dropped_time);
        }
        ship.deaths++;
        ship.custom.respawn_delay = calcRespawn(ship);
        ship.death_stroke++;
        ship.custom.respawnMsgIndex = rand(respawnMsg.length);
        if (event.killer!= null){
          event.killer.frags++;
          event.killer.kill_bonus++;
        }
        update = 1;
        break;
      case "ship_spawned":
        ship.custom.flag_dropped = false;
        if (ship.custom.flag){
          ship.custom.flag = false;
          updateFlagStats();
          teams.flagholder[1-ship.custom.team] = 0;
        }
        ship.set({x:teams.x.spawn[ship.custom.team],y:teams.y.spawn[ship.custom.team],invulnerable:200,stats:88888888});
        shipgems(ship,ship.type);
        break;
      case "ui_component_clicked":
        var component = event.id;
        if (["0","1","2"].indexOf(component) != -1){
          if (gamelength-game.step <= toTick(match_time)){
            sendUI(ship, {id:"0",visible:false});
            sendUI(ship, {id:"1",visible:false});
            sendUI(ship, {id:"2",visible:false});
            sendUI(ship, {id:"ship text",visible:false});
            ship.custom.choose_countdown = game.step;
          } else {
            for (let i=0;i<3;i++) shipUI[i].components = [...shipUI[i].components.slice(0,2)];
            shipUI[component].components.push({type: "text",position:[22.5,50,50,30],value:"",color:"#cde"});
            for (let UI of shipUI) sendUI(ship, UI);
          }
          ship.custom.shiped = true;
          ship.custom.selected = true;
          ship.set({type:data[component].code,invulnerable:200,stats:88888888,shield:999});
          shipgems(ship,data[0].code);
        }
        break;
      case "collectible_picked":
        ship.emptyWeapons();
      break;
    }
  }
};

